            if n % 100 == 0:
                return single_digits[n // 100] + ' hundred'
            else:
                return single_digits[n // 100] + ' hundred and ' + helper(n % 100)
    i = 1
    result = ''
    while num > 0:
        if num % 1000 != 0:
            result = helper(num % 1000) + ' ' + thousands[i] + ' ' + result
        num //= 1000
        i += 1
    return result.strip()

